  "zen.faq.a6":
    "\u0414\u0430, \u0432\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0430\u0434\u0430\u0442\u044c \u043c\u0435\u0441\u044f\u0447\u043d\u044b\u0435 \u043b\u0438\u043c\u0438\u0442\u044b \u0440\u0430\u0441\u0445\u043e\u0434\u043e\u0432 \u0432 \u0441\u0432\u043e\u0435\u043c \u0430\u043a\u043a\u0430\u0443\u043d\u0442\u0435.",
